import data1 from "./Data/1.js";

const Result = () => {
  var indicator = Array(10).fill(0);
  console.log(data1);
  const newArray = data1.sort((a, b) => a[0] - b[0]);
  console.log(newArray);

  for (let i = 0; i < newArray.length; i++) {
    var list = [];
    for (var j = newArray[i][0]; j <= newArray[i][1] - 1; j++) {
      list.push(j);
    }
    console.log(list);

    // list.forEach((index) => {
    //   indicator[index] = 1;
    // });

    console.log(indicator);
  }

  const count1 = indicator.filter((x) => x == 1).length;
  console.log(count1);
  console.log(newArray);

  for (let i = 0; i < newArray.length; i++) {
    var currentMax = 0;
    var index = 0;
    let finalArray = [...newArray];

    finalArray.splice(i, 1);
    console.log(finalArray);

    for (let k = 0; k < finalArray.length; k++) {
      for (var j = finalArray[k][0]; j <= finalArray[k][1] - 1; j++) {
        var list = [];
        list.push(j);
        list.forEach((index) => {
          indicator[index] = 1;
        });
        const count2 = indicator.filter((x) => x == 1).length;
        if (count2 > currentMax) {
          currentMax = count2;
          index = i;
        }
      }
    }
  }
  console.log(currentMax);
  return <div>{data1}</div>;
};

export default Result;
